import React, { useState, useEffect } from "react";
import "../css/VolunteerRegister.css";
import axios from "axios";
import { Link, useNavigate } from "react-router-dom";

const VolunteerRegister = ({ onRegister }) => {
  const [id, setId] = useState("");
  const [Full_Name, setName] = useState("");
  const [Email, setEmail] = useState("");
  const [Password, setPassword] = useState("");
  const [Address, setAddress] = useState("");
  const [City, setCity] = useState("");
  const [State, setState] = useState("");
  const [Country, setCountry] = useState("");
  const [Zip, setZip] = useState("");
  const [Registration, setVolunteers] = useState([]);
  const [errors, setErrors] = useState({});
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    switch (name) {
      case "fullName":
        setName(value);
        break;
      case "email":
        setEmail(value);
        break;
      case "password":
        setPassword(value);
        break;
      case "address":
        setAddress(value);
        break;
      case "city":
        setCity(value);
        break;
      case "state":
        setState(value);
        break;
      case "country":
        setCountry(value);
        break;
      case "zip":
        setZip(value);
        break;
      default:
        break;
    }
  };

  const validateForm = () => {
    let errors = {};
    let isValid = true;

    const passRegex =
      /^(?=.*\d)(?=.*[a-z])(?=.*[A-Z])(?=.*[!@#$%^&*])(?=.{8,})/;

    const emailRegex = /\S+@\S+\.\S+/;
    if (!Full_Name) {
      errors.fullName = "Full Name is required";
      isValid = false;
    }

    if (!Email) {
      errors.email = "Email is required";
      isValid = false;
    } else if (!emailRegex.test(Email)) {
      errors.email = "Email is invalid";
      isValid = false;
    }

    if (!Password) {
      errors.password = "Password is required";
      isValid = false;
    } else if (!passRegex.test(Password)) {
      errors.password =
        " Password must contain at least 8 characters, including one uppercase letter, one lowercase letter, one number, and one special character";
      isValid = false;
    }

    if (!Address) {
      errors.address = "Address is required";
      isValid = false;
    }

    if (!City) {
      errors.city = "City is required";
      isValid = false;
    }

    if (!State) {
      errors.state = "State is required";
      isValid = false;
    }
    if (!Country) {
      errors.country = "Country is required";
      isValid = false;
    }
    if (!Zip) {
      errors.zip = "Zip is required";
      isValid = false;
    }

    setErrors(errors);
    return isValid;
  };

  useEffect(() => {
    (async () => await Load())();
  }, []);

  async function Load() {
    const result = await axios.get("http://localhost:8082/register/getAll");
    setVolunteers(result.data);
    console.log(result.data);
  }

  async function save(event) {
    event.preventDefault();
    if (validateForm()) {
      try {
        await axios.post("http://localhost:8082/register/save", {
          Full_Name: fullName,
          Email: email,
          Password: password,
          Address: address,
          City: city,
          State: state,
          Country: country,
          Zip: zip,
        });
        alert("Volunteer registration has been done successfully");
        setId("");
        setName("");
        setEmail("");
        setPassword("");
        setAddress("");
        setCity("");
        setState("");
        setCountry("");
        setZip("");
        Load();
        navigate("/volunterLogin");
      } catch (err) {
        alert("Volunteer Registration Failed");
      }
    }
  }

  return (
    <div className="main-register">
      <form className="myform">
        {/* ... (previous form fields) */}
        <div class="form-group col-md-12">
          <label for="inputState" className="label-control">
            Country
          </label>
          <input
            type="text"
            name="country"
            class="form-control"
            placeholder="Country"
            id="Country"
            value={country}
            onChange={handleChange}
            required
          />
          {errors.country && (
            <div className="error" style={{ color: "red" }}>
              {errors.country}
            </div>
          )}
        </div>
        <div class="form-group col-md-12">
          <label for="inputZip" className="label-control">
            Pincode
          </label>
          <input
            type="text"
            name="zip"
            class="form-control"
            placeholder="Zip"
            required
            id="Zip"
            value={zip}
            onChange={handleChange}
          />
          {errors.zip && (
            <div className="error" style={{ color: "red" }}>
              {errors.zip}
            </div>
          )}
        </div>
        <div class="text-center">
          <button type="submit" class="btn btn-primary" onClick={save}>
            Register
          </button>
        </div>
      </form>
    </div>
  );
};

export default VolunteerRegister;
